import styled from 'styled-components';

export const HeadingSemi = styled.h3`
  font-size: 1.375rem; //32px
  font-weight: 600;
  line-height: 24px;
  color: #555770;
  margin: 0 0 10px 0;
`;

export const HeadingRegular = styled.h3`
  font-size: 1.375rem; //32px
  font-weight: 00;
  line-height: 24px;
  color: #555770;
  margin: 0 0 10px 0;
`;

export const TextMedium = styled.h3`
  font-weight: 500;
  font-size: 1.25rem;
  line-height: 24px;
  color: #555770;
  margin: 0 0 10px 0;
`;

export const TextSemi = styled.h3`
  font-weight: 600;
  font-size: 1rem;
  line-height: 24px;
  color: #555770;
  margin: 0 0 10px 0;
`;

export const TextMedium16 = styled.h3`
  font-weight: 500;
  font-size: 1rem;
  line-height: 24px;
  color: #555770;
  margin: 0 0 10px 0;
`;
